tgapApp.controller('SummaryPageCtrl', ['$scope', '$element', '$timeout', '$rootScope', function ($scope, $element, $timeout, $rootScope) {
    $rootScope.$on('showSummaryPage', function (event, arg) {
        window.showLoadingMask('<h2>Summary Loading...</h2><p>Your summary is loading.</p>');
        db.transaction(function (tx) {
            // Get the attachments
            tx.executeSql("\
                SELECT * FROM Attachment\
                WHERE InspectionId = '" + arg.inspection.Id + "'\
            ",
            [],
            function (tx, results) {// Success
                arg.inspection.attachedImages = [];
                for (var i = 0; i < results.rows.length; i++) {
                    arg.inspection.attachedImages.push(results.rows.item(i));
                }
            },
            function (error) { // Error
                console.log('showSummaryPage attachments select error: ' + JSON.stringify(error));
            });

        }, function (error) {
            // Transaction error
            console.log('showSummaryPage attachment transaction error: ' + JSON.stringify(error));
            window.hideLoadingMask();
        }, function () { // Transaction success
            var isNewInspection = true;
            if ($scope.inspection && $scope.inspection.Id == arg.inspection.Id) {
                isNewInspection = false;
            }
            $scope.inspection = arg.inspection;
            $scope.status = $scope.inspection.Status;
            $scope.daysToReinspection = $scope.inspection.DaysToReinspection;
            $scope.questions = arg.questions ? arg.questions : JSON.parse(localStorage.getItem($scope.inspection.ChecklistType + "Questions" + $scope.inspection.ChecklistVersion));
            $scope.isCompleted = arg.isCompleted;
            $scope.isViewMode = arg.isViewMode;

            //Set fields value
            if ($scope.isViewMode){
                $scope.unsatCount = $scope.inspection.UnsatCount;
                $scope.currentDate = moment($scope.inspection.InspectionCompletedDatetime).format('MMMM D, YYYY');
                $scope.imageIdCounter = 0;
            } else {
                if (isNewInspection) {
                    $scope.unsatCount = 0;
//                    $scope.inspection.attachedImages = [];
                    $scope.imageIdCounter = 0;
                    $scope.currentDate = moment().format('MMMM D, YYYY');
                    $scope.statusPicklistsValues = JSON.parse(window.localStorage.getItem('StatusPicklistsValues'))[$scope.inspection.RecordType];
                }
            }
//            $scope.$apply();

            $.mobile.pageContainer.pagecontainer('change', '#summary-page', {
                transition: 'slide'
            });
            window.hideLoadingMask();
        });
    });

    $scope.endInspection = function () {
//        $scope.invalidFields = false; //hides auditee signature errors
        //$('#time-tracking-popup').popup('open', {
        //    positionTo: 'window'
        //});
        ////Open time tracking popup
        //$rootScope.$emit('openTimeTrackingPopup', {
        //    inspection: $scope.inspection,
        //    status: $scope.status,
        //    isEndInspection: true,
        //    cbFn: $scope.saveInspectionLocally
        //});

        if ($scope.status) {
            $scope.saveInspectionLocally(true);
            $scope.showErrors = false;
        } else {
            $scope.showErrors = true;
        }
    };

    $scope.saveInspectionLocally = function (isEndInspection) {


        var sig = document.getElementById('signaturepad');
        if (angular.element('#signatureoutput').val() == '')
            $scope.auditeeSignature = '';  
        else 
            $scope.auditeeSignature = sig.toDataURL();  
        $scope.inspection.AuditeeName = $scope.inspection.AuditeeName || '';
        $scope.inspection.AuditeeEmail = $scope.inspection.AuditeeEmail || '';

        if (window.useIndexedDb) {
            //Update values on the record
            var tx = window.db.transaction("Inspection", "readwrite");
            var store = tx.objectStore("Inspection");

            store.get($scope.inspection.Id).onsuccess = function (event) {

                

                var dbInspection = event.target.result;
                dbInspection.EndTime = args.endTimeHr + ':' + args.endTimeMin;
                //dbInspection.BreakDurationMin = args.breakTimeMin;
                //dbInspection.TravelDurationMin = args.travelTimeMin;
                dbInspection.Status = $scope.status;
                dbInspection.AuditeeName = $scope.inspection.AuditeeName;
                dbInspection.AuditeeEmail = $scope.inspection.AuditeeEmail ? $scope.inspection.AuditeeEmail.replace(/\ /g, ";") : '';
                console.log($scope.auditeeSignature);
                dbInspection.AuditeeSignature = $scope.auditeeSignature;
                dbInspection.InspectionCompletedDatetime = moment().toDate();
                dbInspection.UnsatCount = $scope.unsatCount;

                store.put(dbInspection).onsuccess = function (event) {
                    $.mobile.pageContainer.pagecontainer('change', '#inspection-list-page', {
                        transition: 'slide'
                    });

                    //Open time tracking popup
                    $rootScope.$emit('completedInspection', {
                        inspection: $scope.inspection
                    });
                };
            };
        } else {
            //Update values on the record
            db.transaction(function (tx) {
                if(isEndInspection){
                    tx.executeSql("UPDATE Inspection SET EndTime = '" + moment().hour() + ':' + moment().format('mm')
                        + "', Status = '" + $scope.status
                        + "', AuditeeName = '" + $scope.inspection.AuditeeName
                        + "', AuditeeEmail = '" + $scope.inspection.AuditeeEmail
                        + "', AuditeeSignature ='" + $scope.auditeeSignature
                        + "', InspectionCompletedDatetime = ?, DaysToReinspection = ?"
                        + ", UnsatCount = " + $scope.unsatCount
                        + " WHERE Id = '" + $scope.inspection.Id + "'", [moment().toDate(), $scope.daysToReinspection]);
                } else {
                    tx.executeSql("UPDATE Inspection SET Status = '" + $scope.status
                        + "' WHERE Id = '" + $scope.inspection.Id + "'", []);
                }

//                angular.forEach($scope.inspection.attachedImages, function (image, key) {
//                    tx.executeSql("INSERT INTO Attachment (Id, InspectionId, ImgData) VALUES (?, ?, ?)",
//                    [image.id, $scope.inspection.Id, image.ImgData]);
//                });
            }, function (error) {
                console.log('saveInspectionLocally update error=' + JSON.stringify(error));
            }, function () {
                if(isEndInspection){
                    $.mobile.pageContainer.pagecontainer('change', '#inspection-list-page', {
                        transition: 'slide'
                    });

                    //Open time tracking popup
                    $rootScope.$emit('completedInspection', {
                        inspection: $scope.inspection
                    });
                }
            });
        }
    };

    $scope.goBackToChecklist = function () {
        $rootScope.$emit('goToQuestionOnChecklist', {
            question: null,
            inspection: $scope.inspection
        });
    };

    $scope.addInspectionNotes = function ($event) {
        if (!$scope.isViewMode) {
            $rootScope.$emit('addInspectionNotes', {
                inspection: $scope.inspection,
                $event: $event
            });
        }
    };

    $scope.attachImage = function () {

        navigator.camera.getPicture(function (imageData) { // Success

            $scope.imageIdCounter++;
            //Attach the image on inspection
            $scope.inspection.attachedImages.push({
                ImgData: imageData,
                Id: $scope.inspection.Id + $scope.imageIdCounter,
                isStored: false
            });

            db.transaction(function (tx) {
                tx.executeSql("INSERT INTO Attachment (Id, InspectionId, ImgData) VALUES (?, ?, ?)",
                    [$scope.inspection.Id + $scope.imageIdCounter, $scope.inspection.Id, imageData]);
            }, function (error) {
                console.log('save attachment error=' + JSON.stringify(error));
            }, function () {
            });

            if (window.isDebugMode) {
                //console.log($scope.inspection.attachedImages);
                //alert('Took images = ' + $scope.inspection.attachedImages.length);
            }
            if (!$scope.$$phase) {
                $scope.$apply();
            }
        }, function (message) { // Failed
            console.log('SummaryPageCtrl attachImage failed = ' + message);
        }, {
            quality: 50,
            destinationType: Camera.DestinationType.DATA_URL,
            encodingType: Camera.EncodingType.JPEG,
            targetWidth: 960,
            targetHeight: 1280
        });

      /* 
        $scope.imageIdCounter++;
//        // For testing attachment on Chrome
        $scope.inspection.attachedImages.push({
            ImgData: '',
            Id: $scope.inspection.Id + $scope.imageIdCounter,
            isStored: false
        });

        db.transaction(function (tx) {
            tx.executeSql("INSERT INTO Attachment (Id, InspectionId, ImgData) VALUES (?, ?, ?)",
                [$scope.inspection.Id + $scope.imageIdCounter, $scope.inspection.Id, '']);
        }, function (error) {
            console.log('save attachment error=' + JSON.stringify(error));
        }, function () {
        }); */

    };

    $scope.removeImage = function (index) {
        db.transaction(function (tx) {
            tx.executeSql("DELETE FROM Attachment WHERE Id = '" + $scope.inspection.attachedImages[index].Id + "'");
        }, function (error) {
            console.log('remove attachment error=' + JSON.stringify(error));
        }, function () {
            $scope.inspection.attachedImages.splice(index, 1);
//            $scope.imageIdCounter--;
            if (!$scope.$$phase) {
                $scope.$apply();
            }
        });
    };

    $scope.saveStatus = function () {
        $scope.inspection.Status = $scope.status;
        $scope.saveInspectionLocally(false);
    };
}]);
